import{_ as g}from"./plugin-vue_export-helper-c27b6911.js";import{r as l,o as p,c as e,a as o,b as i,e as a,d as r,f as s}from"./app-3fad0725.js";const h={},n=i("p",null,[i("strong",null,"民都有山"),a("，又稱面托油山，海拔1798公尺，位於新竹縣五峰鄉，立有二等三角點No.1537及山字森林三角點，山頂南向有展望，可遠眺雪山山脈，登山路徑明顯，不乏登山路條，沿途林相優美，一路走來涼爽舒適。")],-1),m=i("p",null,[i("strong",null,"民都有山北峰"),a("，海拔1280公尺，有顆山字森林三角點，果園中無視野，自民都有山登山口進入後不久，見方形水泥水塔叉路，取左進入便可見基石，可順便造訪。")],-1),b=s('<p>走走日期：2016/07/16</p><h2 id="行車路線" tabindex="-1"><a class="header-anchor" href="#行車路線" aria-hidden="true">#</a> 行車路線</h2><p>竹東行駛122縣道往五峰，至122縣道約48K處左轉下行往清泉風景區(直行往觀霧)，行約160公尺見右側清泉石碑再取左下(直行往清泉風景區)，過民都有大橋後行駛產業道路往上，依「愛上喜翁」民宿指標前進，行約7K至愛上喜翁叉路取直行(左往愛上喜翁)，再行駛約一百多公尺，至鐵皮屋轉彎處空地停車。(產業道路部分路段狹窄，會車不易，必須小心注意)</p><h2 id="走走路線" tabindex="-1"><a class="header-anchor" href="#走走路線" aria-hidden="true">#</a> 走走路線</h2><p>→停車整裝<br><img src="https://1013399.github.io/image-1/45/1132725165_l.jpg" alt="IMGP9608.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→出發，續行產業道路往上，經過鐵柵門(鐵柵門若關閉，可從旁繞過)<br><img src="https://1013399.github.io/image-1/45/1132724672_l.jpg" alt="IMGP9609.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→途中可眺望北埔五指山<br><img src="https://1013399.github.io/image-1/45/1132726009_l.jpg" alt="IMGP9610.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→叉路，左往愛上喜翁民宿，取右上續行<br><img src="https://1013399.github.io/image-1/45/1132724272_l.jpg" alt="IMGP9611.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→經過基利心山莊(雲端上的家)<br><img src="https://1013399.github.io/image-1/45/1132725380_l.jpg" alt="IMGP9612.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→產道終止，民都有山登山口，右邊有一綠色圓形大水塔<br><img src="https://1013399.github.io/image-1/45/1132726011_l.jpg" alt="IMGP9614.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→行約20公尺遇叉路，有一方形水泥水塔，先取左入往民都有山北峰<br><img src="https://1013399.github.io/image-1/45/1132725450_l.jpg" alt="IMGP9615.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→民都有山北峰，山字森林三角點，拍照後，原路回叉路口續行<br><img src="https://1013399.github.io/image-1/45/1132724674_l.jpg" alt="IMGP9616.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→十字叉路，樹上釘有注意告示牌No.08，取右續行<br><img src="https://1013399.github.io/image-1/45/1132725168_l.jpg" alt="IMGP9617.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→進入平緩好走的腰繞水管路<br><img src="https://1013399.github.io/image-1/45/1132724195_l.jpg" alt="IMGP9618.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→崩塌處，水管接至一圓形水塔<br><img src="https://1013399.github.io/image-1/45/1132725451_l.jpg" alt="IMGP9619.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→拉繩陡上<br><img src="https://1013399.github.io/image-1/45/1132725564_l.jpg" alt="IMGP9620.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→再接上平緩的腰繞路<br><img src="https://1013399.github.io/image-1/45/1132724569_l.jpg" alt="IMGP9621-22.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→繞過酷似鴨頭的倒木<br><img src="https://1013399.github.io/image-1/45/1132725565_l.jpg" alt="IMGP9623.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→陡上<br><img src="https://1013399.github.io/image-1/45/1132725169_l.jpg" alt="IMGP9624-25.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→接上另一段平緩的腰繞路<br><img src="https://1013399.github.io/image-1/45/1132725566_l.jpg" alt="IMGP9626.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→休息空地，不休息左彎續行<br><img src="https://1013399.github.io/image-1/45/1132726113_l.jpg" alt="IMGP9627.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→再度陡上<br><img src="https://1013399.github.io/image-1/45/1132724771_l.jpg" alt="IMGP9628-29.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→上至寬稜<br><img src="https://1013399.github.io/image-1/45/1132724571_l.jpg" alt="IMGP9630.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→鞍部空地，在此休息<br><img src="https://1013399.github.io/image-1/45/1132726114_l.jpg" alt="IMGP9631.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→空地旁有棵中空樹<br><img src="https://1013399.github.io/image-1/45/1132725930_l.jpg" alt="IMGP9632.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→續行，進入雜木林<br><img src="https://1013399.github.io/image-1/45/1132724772_l.jpg" alt="IMGP9634.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→連續陡上約十餘分鐘<br><img src="https://1013399.github.io/image-1/45/1132725938_l.jpg" alt="IMGP9635-38.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→叉路，右往松鷹道路出清泉(可往清泉山、雲山)，取左往民都有山<br><img src="https://1013399.github.io/image-1/45/1132725453_l.jpg" alt="IMGP9639.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→出現箭竹林，即將到達山頂<br><img src="https://1013399.github.io/image-1/45/1132724197_l.jpg" alt="IMGP9641.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→民都有山山頂<br><img src="https://1013399.github.io/image-1/45/1132723594_l.jpg" alt="IMGP9646.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→民都有山，二等三角點No.1537及山字森林三角點<br><img src="https://1013399.github.io/image-1/45/1132724572_l.jpg" alt="IMGP9642-45.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→山頂南向有展望，遠眺雪霸聖稜線<br><img src="https://1013399.github.io/image-1/45/1132724278_l.jpg" alt="IMGP9649.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→以手機APP(Peakview)點名群山<br><img src="https://1013399.github.io/image-1/45/1132726201_l.jpg" alt="IMGP9649A.png - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→山頂東南側有片涼蔭空地，空地旁有明顯山徑可往高橋山，在此休息午餐<br><img src="https://1013399.github.io/image-1/45/1132724198_l.jpg" alt="IMGP9648.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→山頂涼爽舒適，在此休息了二個小時後，原路下山</p><p>→回到中空樹鞍部空地，不休息續行<br><img src="https://1013399.github.io/image-1/45/1132726502_l.jpg" alt="IMGP9650.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→路旁發現稀有植物「八角蓮」<br><img src="https://1013399.github.io/image-1/45/1132726402_l.jpg" alt="IMGP9651.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→八角蓮的橢圓形漿果<br><img src="https://1013399.github.io/image-1/45/1132726306_l.jpg" alt="IMGP9652.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→下山途中也可見淡紫清雅的「長距根節蘭」<br><img src="https://1013399.github.io/image-1/45/1132725935_l.jpg" alt="IMGP9654.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→回到北峰叉路口<br><img src="https://1013399.github.io/image-1/45/1132726117_l.jpg" alt="IMGP9655.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→回到登山口<br><img src="https://1013399.github.io/image-1/45/1132724576_l.jpg" alt="IMGP9656.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→回到基利心山莊，越野車委員會在此辦活動<br><img src="https://1013399.github.io/image-1/45/1132723853_l.jpg" alt="IMGP9657.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><p>→回到停車處<br><img src="https://1013399.github.io/image-1/45/1132725573_l.jpg" alt="IMGP9659.JPG - 【新竹五峰】民都有山北峰、民都有山" loading="lazy"></p><h2 id="走走資訊" tabindex="-1"><a class="header-anchor" href="#走走資訊" aria-hidden="true">#</a> 走走資訊</h2><div class="hint-container info"><p class="hint-container-title">相關信息</p><p>走走時間：上山約2小時、下山約1小時20分鐘</p><p>高低落差：約600公尺</p></div><h2 id="參考地圖" tabindex="-1"><a class="header-anchor" href="#參考地圖" aria-hidden="true">#</a> 參考地圖</h2>',46),c={href:"https://www.keepon.com.tw/thread-e8e49c0f-3c05-e611-80c2-901b0e54a4e6.html",target:"_blank",rel:"noopener noreferrer"},d=i("figure",null,[i("img",{src:"https://1013399.github.io/image-1/45/1132724284_l.jpg",alt:"民都有山.jpeg - 【新竹五峰】民都有山北峰、民都有山",tabindex:"0",loading:"lazy"}),i("figcaption",null,"民都有山.jpeg - 【新竹五峰】民都有山北峰、民都有山")],-1);function P(G,_){const t=l("ExternalLinkIcon");return p(),e("div",null,[n,m,o(" more "),b,i("p",null,[a("原圖連結→"),i("a",c,[a("登山補給站-frank348(FrankLee)"),r(t)])]),d])}const I=g(h,[["render",P],["__file","post-45-2016-07-19.html.vue"]]);export{I as default};
